import React, { useState, useEffect } from "react";
import {
  IonContent,
  IonLabel,
  IonButton,
  IonInput,
  IonItem,
  IonIcon,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
  IonGrid,
  IonRow,
  IonCol,
  IonDatetime,
  IonTextarea,
  useIonViewDidEnter,
} from "@ionic/react";
import { arrowBackCircle } from "ionicons/icons";
import axios from "axios";
import {
  Link,
  matchPath,
  match,
  useRouteMatch,
  RouteComponentProps,
} from "react-router-dom";
import "./Profile.css";
import GetUser from "../components/GetUser";

interface EditShiftDetailsProps
  extends RouteComponentProps<{
    id: string;
  }> {}

const EditShift: React.FC<EditShiftDetailsProps> = ({ match }) => {
  interface ProfileData {
    UserId: number;
  }

  const [profile, setProfile] = useState<ProfileData>({
    UserId: 0,
  });

  useIonViewDidEnter(() => {
    GetUser().then((data) => setProfile(data.personDataFound));
  }, []);

  interface SchedJobData {
    ShiftId: number;
    ShiftIdentifier: string;
    UserUserId: string;
    DateDay: string;
    StartDateTime: string;
    FinishDateTime: string;
    NumberOfWerkers: number;
    Company: string;
    Location: string;
    Pay: string;
    ShiftNotes: string;
  }

  const [editSchedJob, setEditSchedJob] = useState<SchedJobData>({
    ShiftId: 0,
    ShiftIdentifier: "",
    UserUserId: "",
    DateDay: "",
    StartDateTime: "",
    FinishDateTime: "",
    NumberOfWerkers: 0,
    Company: "",
    Location: "",
    Pay: "",
    ShiftNotes: "",
  });

  interface SchedWerkersData {
    UserId: number;
    FirstName: string;
    LastName: string;
    ProfilePicURL: string;
  }
  const [werkers, setWerkers] = useState<SchedWerkersData[]>([
    {
      UserId: 0,
      FirstName: "",
      LastName: "",
      ProfilePicURL: "",
    },
  ]);

  interface OpenShiftData {
    unfilledshifts: number;
    ShiftStatus: string;
  }
  const [openShifts, setOpenShifts] = useState<OpenShiftData>({
    unfilledshifts: 0,
    ShiftStatus: "",
  });

  const fetchEditSchedJob = () => {
    return axios
      .get(
        "http://werkappserver-env.eba-qyjsvfm3.us-east-1.elasticbeanstalk.com//shifts/SchedShiftDetails/" + match.params.id,
        {
          withCredentials: true,
        }
      )
      .then((thing) => {
        console.log(thing);
        return thing.data;
      });
  };

  useIonViewDidEnter(() => {
    fetchEditSchedJob().then((data) => {
      setEditSchedJob(data.WerkShift);
      setWerkers(data.Werkers);
      setOpenShifts(data.OpenShifts);
    });
  }, []);

  console.log(editSchedJob);

  const handleSubmit = () => {
    axios
      .put("http://werkappserver-env.eba-qyjsvfm3.us-east-1.elasticbeanstalk.com//shifts/EditSchedShift/", {
        withCredentials: true,
        editSchedJob,
      })
      .then((response) => {
        console.log(response);
        window.location.href = "/SchedShiftDetails/" + editSchedJob.ShiftId;
      });
  };

  const Daterillo: React.FC = () => {
    return (
      <React.Fragment>
        <IonDatetime
          min="2020-06-04"
          max="2100-08-23"
          displayFormat="MMM D, YYYY"
          value={editSchedJob.DateDay}
        ></IonDatetime>
      </React.Fragment>
    );
  };

  const StartTimerillo: React.FC = () => {
    return (
      <React.Fragment>
        <IonDatetime
          displayFormat="h:mm A"
          value={editSchedJob.StartDateTime}
        ></IonDatetime>
      </React.Fragment>
    );
  };

  const EndTimerillo: React.FC = () => {
    return (
      <React.Fragment>
        <IonDatetime
